#include <stdio.h>
#include <stdlib.h>

#define MAX_H 20
#define MAX_W 20

int h, w;
char board[MAX_H][MAX_W + 1];
int mark[MAX_H][MAX_W];

int dfs(int x, int y) {
    if (x < 0 || x >= h || y < 0 || y >= w || board[x][y] == 'X' || board[x][y] == '#') {
        return 0;
    }
    if (mark[x][y]) {
        return 1;
    }
    mark[x][y] = 1;
    int res = 1;
    res += dfs(x - 1, y);
    res += dfs(x + 1, y);
    res += dfs(x, y - 1);
    res += dfs(x, y + 1);
    return res;
}

int main() {
    scanf("%d %d", &h, &w);
    for (int i = 0; i < h; i++) {
        scanf("%s", board[i]);
    }
    int first = 0;
    for (int i = 0; i < h; i++) {
        for (int j = 0; j < w; j++) {
            if (board[i][j] == '.') {
                mark[i][j] = 0;
                if (dfs(i, j) % 2 == 0) {
                    first = 1;
                }
            }
        }
    }
    if (first) {
        printf("First\n");
    } else {
        printf("Second\n");
    }
    return 0;
}
